import React from 'react';
import fondo from "../../img/pokemon.jpg"
import {s} from "../css/ini"
const Inicio = () => {
    return ( 
    <div>
    <img className={s.fondo}  src={fondo}  alt='Imagen de fondo'/>
    </div> );
}
 
export default Inicio;
